import Projects from "./Containers/Projects/Projects";
import Contacts from "./Containers/Contact/Contacts";
export default function App(){

     const fun = (event)=>{
         if(event.offsetY > 50)
         {
             document.getElementById
         }
     }
     window.addEventListener("mouseover",fun);

    return(
        <>
        <div className="container">
        <Header  />
        <Intro className="scr " id="src" />
        <Skill className="scroll " />
        <Projects className="scroll"/>
        <Contacts className="scroll" />
        </div>
       
       </>);
}
